coins = 0

def provide_hint(word, hint_level):
    return word[:hint_level]

def guess_the_word(word):
    global coins
    hint_level = 2
    print(f"Отгадайте слово по первым двум буквам: {provide_hint(word, hint_level)}")
    
    while True:
        player_input = input('Ваш вариант: ').strip().lower()
        
        if player_input == "подсказка":
            hint_level += 1
            if hint_level <= len(word):
                print(f"Подсказка: {provide_hint(word, hint_level)}")
            else:
                print(f"Подсказка: {word}")
        else:
            if player_input == word.lower():
                coins += 1
                print(f"Поздравляем! Вы угадали слово! Монеток: {coins}")
                return True
            else:
                print("Попробуйте ещё раз.")

